    applicationId,
    groupMembers,
    groupName,
    indexId,
    type,
    params::AbstractDict{String};
    aws_config::AbstractAWSConfig=global_aws_config(),
)
    return qbusiness(
        "PUT",
        "/applications/$(applicationId)/indices/$(indexId)/groups",
        Dict{String,Any}(
            mergewith(
                _merge,
                Dict{String,Any}(
